Laipni lūdzam Pērļu Medībās - lielākajā Latvijas online apģērbu tirdzniecības sludinājumu portālā!

Pērc un Pārdod Andelēmandelē - online vietnē, kur privātpersonām ir iespēja izpārdot savu personīgo garderobes saturu: apģērbs, apavi, aksesuāri, somas, viss bērniem, mājlietas utt.

Pievienojies un ielūkojies  60 000 Latvijas Dāmu garderobēs un 45 000 aktīvajos sludinājumos!

Andelēmandelē Tu vari:

Pārdot:
· Savu personīgo  garderobes saturu, kas Tev pašai nav vairs aktuāls, bet citam var būt īsts atradums!
· Ērti un ātri pievienot savu sludinājumu, apstrādāt sludinājuma bildes, un tas būs redzams 60 000 portāla lietotāju, starp kuriem noteiktu atradīsies arī īstais pircējs;
· Aplikācija Tev vienmēr atgādinās par pienākušajiem Pērļu pieteikumiem un interesentu vēstulēm;
· Izveido  savu personīgo virtuālo garderobi un kolekcionē sekotājas- pircējas  savai Pērlēm;
· Jo kvalitatīvāk noformēti sludinājumi, jo lielāka iespēja, ka tie tiks pievienoti Superpērlēm, kas uzrādās pircējiem lapas augšgalā;
· Sludinājuma pievienošanai izmanto maciņu, kuru papildināt vari ar Interneta banku, bankas karti, vai arī vari norēķināties par katru sludinājumu atsevišķi ar SMS.

Pirkt:
· Izvēlies savus pirkumus no vairāk kā 45 000 aktīvajiem sludinājumiem un vairāk kā 4500 zīmoliem,
· Vidējā Pērles cena ir par 70-90% zemāka no iegādes cenas;
· Iepirkumiem izmanto ērto meklētāju- pēc kategorijas, izmēra, krāsas, materiāla, zīmola, atrašanās vietas;
· Norēķinies ar pircēju pa tiešo, portāls nenodrošina transakcijas starp pircēju - pārdevēju.

Esi aktīva
· Seko savām favorītu garderobēm, tirgotājiem, zīmoliem, saņem notifikācijas par jaunākajām favorītlietotāju pievienotajām lietām un nepalaid garām savu Superpērli;
· Foruma sadaļā vari veikt koppasūtījumus, izziņot kādas īpašas lietas meklēšanu, diskutēt ar citām pērļu medniecēm.

Veiksmīgas Pērļu Medības!

Drogas – lielākais kosmētikas un sadzīves preču mazumtirdzniecības veikalu tīkls Baltijā. Pieejami vairāk nekā 700 zīmoli Tavam skaistumam, mājai un veselībai par vispievilcīgākajām cenām tikai dažu “klikšķu” attālumā; 
Ātra un ērta iepirkšanās; 
Ātra un droša pirkuma apmaksa;  
Ātri un ērti apskatāmas jaunākās akcijas un labākie piedāvājumi; 
Drogas Klienta karte digitālā formātā vienmēr līdzās telefonā; 
Iespēja izvēlēties ērtāko no trim piegādes veidiem: 

-Saņem pirkumu Drogas veikalā 1-2 darbdienu laikā (Eur 0.99, pirkumam virs Eur 14.99 – piegāde BEZ MAKSAS). Kad pasūtījums būs nogādāts veikalā, saņemsi SMS ar PIN kodu pasūtījuma saņemšanai. 
-Pakomāti visā Latvijā (Eur 1.69, pirkumam virs Eur 39.99 – BEZ MAKSAS).
-Piegāde uz mājām/biroju visā Latvijā ar kurjerdienestu (Eur 3.99, pirkumam virs Eur 39.99 – piegāde BEZ MAKSAS).  
-Fiziskām personām Rīgā iespējamas dienas 09:00-18:00 un vakara piegādes 18:00-22:00. 

Vienkārši un ērti piekļūsti savam Drogas kontam; 
Pārbaudi uzkrāto punktu atlikumu; 
Apskati savu pasūtījumu vēsturi; 
Veido savu vēlmju sarakstu; 
Ātri un ērti atjauno sava profila informāciju.

Объявления о продаже новых или подержанных (б/у) автомобилей с возможностью проверки авто по VIN-коду.

База объявлений Дрома от частных лиц и автосалонов насчитывает более 600 000 предложений со всей России. Машины на любой вкус и цвет, прямо с мобильного.


Купить авто на Дроме — легко!


– Нужный вам автомобиль легко отыскать с помощью фильтров.
Укажите интересующие параметры, например, модель, год выпуска и объем двигателя – приложение само подберет подходящие варианты.
– Подписывайтесь на объявления по интересным для вас параметрам
– Читайте отзывы других автовладельцев и делитесь своим опытом
– С помощью «полного отчета об авто» по VIN (вин) коду узнайте о его судьбе (ГИБДД, ПДД, Штрафы, аресты, ДТП, ГАИ)



Продать машину — ещё проще!

Размещайте объявления о продаже вашего авто прямо с телефона. Рассказывайте о характеристиках вашего авто или мото.
Дополняйте описание фотографиями.

Также, благодаря приложению, вы сможете:

– создавать подписки на объявления по интересующим параметрам автомобиля;
– получать моментальные уведомления о новых объявлениях;
– добавлять в избранное заинтересовавшие вас автомобили;
– проверять авто по вин-номеру в базе ГИБДД;
– добавлять заметки к объявлениям;
– управлять вашими объявлениями;
– переписываться с продавцами;
– получать уведомления об изменении цен на избранные авто и на другие события;
– сравнивать объявления между собой.


Если у вас возникли сложности с приложением, вы можете написать на почту mobile@drom.ru, и команда наших разработчиков обязательно поможет вам разобраться с проблемой.
